  color: red;
}
#footer .foot_mid .ft_info1 .info_spanBox2 span:nth-child(4) a {
  color: blue;
}
#footer .foot_mid .ft_info1 .info_spanBox2 select {
  width: 150px;
  height: 35px;
  outline: none;
  border: none;
  background-color: none;
  font-size: 12px;
  font-weight: bold;
  background-color: #eee;
  text-align: center;
  color: #444;
}
#footer .foot_btm {
  width: 45%;
  height: 32vh;
  margin: 0;
  padding: 0;
  padding: 20px;
  box-sizing: border-box;
}
#footer .foot_btm .ft_info2 {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  justify-content: space-between;
  height: 15vh;
}
#footer .foot_btm .ft_info2 span {
  display: inline-block;
  height: 0px;
  text-align: left;
  font-weight: normal;
  letter-spacing: -0.5px;
}
#footer .foot_btm .ft_info2 span:nth-child(1) {
  padding: 0;
  text-align: left;
}
#footer .foot_btm .ft_info2 span:nth-child(4) a,
#footer .foot_btm .ft_info2 span:nth-child(8) a {
  font-weight: bold;
  color: #002053;
}
#footer .foot_btm .ft_info2 span:nth-child(7) {
  font-size: 12px;
  font-weight: bold;
  letter-spacing: -0.4px;
}
#footer .foot_btm .ft_info2 span:nth-child(7) a {
  color: #002053;
}
#footer .foot_btm .ft_info2 span:nth-child(9) {
  font-weight: bold;
  color: red;
}
#footer .foot_btm .ft_CS_CENTER {
  width: 100%;
  height: 10vh;
  margin-top: 4vh;
}
#footer .foot_btm .ft_CS_CENTER .CS_btn {
  height: 10vh;
  float: left;
}
#footer .foot_btm .ft_CS_CENTER .CS_btn input {
  display: none;
}
#footer .foot_btm .ft_CS_CENTER .CS_btn label {
  display: inline-block;
  width: 150px;
  height: 40px;
  text-align: center;
  line-height: 40px;
  font-size: 14px;
  border-radius: 30px;
  border: 2px solid #002053;
  background-color: #fff;
  margin-top: 15px;
  box-shadow: 1.5px 1.5px 3px #000;
  color: #000;
}
#footer .foot_btm .ft_CS_CENTER .CS_btn label:hover {
  background-color: #002053;
  color: #fff;
  transition: 0.3s;
}
#footer .foot_btm .ft_CS_CENTER h1 {
  width: 150px;
  height: 70px;
  line-height: 70px;
  float: left;
  margin-right: 25px;
  color: #000;
  text-align: right;
}
#footer .foot_btm .ft_CS_CENTER h1:nth-child(2) {
  float: right;
  height: 50px;
}
#footer .foot_btm .ft_CS_CENTER h1:nth-child(3) {
  width: 250px;
  margin-right: 0;
}
#footer .foot_btm .ft_CS_CENTER p {
  width: 130px;
  height: 35px;
  margin-right: 20px;
  padding-top: 5px;
  text-align: center;
  float: right;
